// src/pages/HomePage.js
import React from 'react';
import Header from '../components/Header';
import HeroSection from '../components/HeroSection';
import Footer from '../components/Footer';
import '../assets/fonts/Quicksand-Regular.ttf';
import '../assets/fonts/Poppins-Regular.ttf';



const HomePage = () => (
  <div>
    <Header />
    <HeroSection />

    <div style={styles.sectionContainer}>
      <h2 style={styles.headerText}>Listen To Our Latest Episode</h2>
      <div style={styles.subText}>Stay Up To Date</div>
    </div>

    <Footer />
  </div>


);


const styles = {
  sectionContainer: {
    width: '100%',
    height: '100%',
    background: 'white',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    padding: '40px 20px', // Adds some padding for content
    boxSizing: 'border-box',
  },

  headerText: {
    width: '100%',
    textAlign: 'center',
    color: '#5A4283',
    fontSize: '40px',
    fontFamily: 'Quicksand',
    fontWeight: '700',
    wordWrap: 'break-word',
  },

  subText: {
    width: '100%',
    textAlign: 'center',
    color: 'black',
    fontSize: '22px',
    fontFamily: 'Poppins, sans-serif',
    fontWeight: '400',
    wordWrap: 'break-word',
    marginTop: '10px', // Adds a small gap between the elements
  },
};

export default HomePage;
